import "../styles.css";
import CourseComponent from "./courses/CourseComponent";
import NumberRangeCheckerComponent from "./courses/NumberCheckComponent";
import TicketDetailComponent from "./courses/TicketDetailComponent";

interface Course {
  title: string;
}

const MainContentComponent = () => {
  const courses: Course[] = [
    { title: "JavaScript" },
    { title: "TypeScript" },
    { title: "Angular" },
    { title: "React" },
  ];
  return (
    <div id="mainContent">
      <span>Login to Access Classroom Courses</span>
      <span className="separator"></span>
      {courses.map(function (course, i) {
        return <CourseComponent key={i} title={course.title} />;
      })}
      <NumberRangeCheckerComponent title="hello"/>
      <TicketDetailComponent title="mr." name="khuna" seat={10}/>
    </div>
  );
};

export default MainContentComponent;
